import React from 'react'
import 'fontsource-roboto';
import Header from './Components/Header'
import Footer from './Components/Footer'
import CreateNote from './Components/CreateNote'
import Note from './Components/Note'
import './App.css';

function App() {
  return (
    <React.Fragment>
    <Header />
    <CreateNote />
    <Note />
    <Footer />
    </React.Fragment>
  );
}

export default App;
